import React from 'react';
import './App.css';
import Counter from './Counter';

function App() {



  return (
    <div className="App">
      <div id='counters'>
        <Counter 
          labelId='break-label' 
          label='Break Length' 
          time={5}
          incrementId='break-increment'
          decrementId='break-decrement'
        />
        <Counter 
          labelId='session-label' 
          label='Session Length' 
          time={25}
          incrementId=''
          decrementId=''
        />



      </div>
    </div>
  );
}

export default App;
